import React, { useState } from 'react';
import {HashRouter as Router, Route, Switch} from 'react-router-dom';
function App() {
  return (
    <React.Fragment>
      <Router basename='/'>
      <NavBar/>
        <Switch>
          <Route exact path='/' component={props => <Home/>}/>
          <Route exact path='/promos' component={props => <Promo/>}/>
        </Switch>
        <FooterPage/>
      </Router>

    </React.Fragment>
  );
}

export default App;
